import VueRouter from 'vue-router';
// 依次引入在路由中进行配置的组件；
import Container from '../components/Container.vue'

import done from '@/pages/DoneThing.vue'
import task from '../components/Task.vue'


import myDay from '../components/MyDay.vue'
import importantAffairs from '../components/ImportantAffairs.vue'


export default new VueRouter({
    routes: [
        {
            path: '',
            component: Container,
        },
        {
            path: '/importantAffairs',
            components: importantAffairs,
        },
        {
            path: '/done',
            components: done,
        },
        {
            path: '/myDay',
            components: myDay,
        },
        {
            path: '/task',
            components: task,
        },
    ]


})
